import React, { Component } from "react";
import { Route } from "react-router-dom";
import Home from "./Home/Home.js";
import Search from "./Search.js";
import Contact from "./Contact.js";
import About from "./About.js";
// import component xem full bảng tin
import NewsFullView1 from "./Home/news/newsFullView/NewsFullView1.js";
import NewsFullView2 from "./Home/news/newsFullView/NewsFullView2.js";
import NewsFullView3 from "./Home/news/newsFullView/NewsFullView3.js";
import NewsFullView4 from "./Home/news/newsFullView/NewsFullView4.js";
import NewsFullView5 from "./Home/news/newsFullView/NewsFullView5.js";
import NewsFullView6 from "./Home/news/newsFullView/NewsFullView6.js";

class RouterURL extends Component {
  render() {
    return (
      <div>
        <Route exact path={process.env.PUBLIC_URL + "/"} component={Home} />
        <Route exact path={process.env.PUBLIC_URL + "/home"} component={Home} />
        <Route exact path={process.env.PUBLIC_URL + "/search"} component={Search} />
        <Route exact path={process.env.PUBLIC_URL + "/contact"} component={Contact} />
        <Route exact path={process.env.PUBLIC_URL + "/about"} component={About} />

        {/* chuyển đến trang xem full bảng tin */}
        <Route exact path={process.env.PUBLIC_URL + "/newfullview1"} component={NewsFullView1} />
        <Route exact path={process.env.PUBLIC_URL + "/newfullview2"} component={NewsFullView2} />
        <Route exact path={process.env.PUBLIC_URL + "/newfullview3"} component={NewsFullView3} />
        <Route exact path={process.env.PUBLIC_URL + "/newfullview4"} component={NewsFullView4} />
        <Route exact path={process.env.PUBLIC_URL + "/newfullview5"} component={NewsFullView5} />
        <Route exact path={process.env.PUBLIC_URL + "/newfullview6"} component={NewsFullView6} />

      </div>
    );
  }
}

export default RouterURL;
